[商品仕様]<br>
○商品サイズ　1個：約縦28×横40×10mm<br>
○パッケージサイズ　約180×108×16ｍｍ<br>
○材　質　ABS樹脂・ポリカーボネート<br>
○生産国　中国<br>
○その他　リラックマとコリラックマ各1個ずつのセット・ブリスターパッケージ入り<br>
★取付条件★　ボルトの頭部のサイズが直径13mm以下、高さ6mm以下のナンバーボルトにのみ取り付けが可能です。通常のワッシャーと併用でスプリングワッシャーを使用している場合は、高さが6mm以上になる為、取付できません。

